import React from "react";
import s from "./Header.module.css";
import logo from "../../"

const Header = () => {
  return (
    <div>
      <div>
        <img src={logo} />
      </div>
      <div className={s.logoText}>
        <a href="#">Shadow Store</a>
      </div>
    </div>
  );
};

export default Header;
